  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:23.912682\",\n\t\"name\": \"merced-national-wildlife-refuge-annual-narrative-report-calendar-year-1989\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Merced
  NWR outlines Refuge accomplishments during the 1989 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses compliance with
  environmental and cultural resource mandates. Refuge administration is outlined;
  information about personnel, volunteer programs, funding, and safety is given. Habitat
  management is also covered; subjects include wetlands, croplands, grasslands, grazing,
  fire management, pest control, and water rights. The wildlife section of the report
  discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, fisheries resources, marking and bird banding, and disease
  control. The public uses of the Refuge described in this report include interpretive
  programs, hunting, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, and energy conservation. Cooperative programs are provided at the end.\",\n\t\"license_title\":
